import React,{Component} from "react"

export default class AppContainer extends Component {
    constructor (){
        super()

        this.state = {
            user: {
                isLoggedIn: false,
                _id: null,
                _email: null
            }
        }
    }

    render(props) {
        return (
            {children}
        )
    }
}
